import Layout from '../components/Layout';
import Link from 'next/link';
import fetch from 'isomorphic-unfetch';

const key = 'XB3vY8VxHRq2gORl6Vs2VspjBmFj26eG1WD91SU09nWCQonR6L';
const secret = '3bPz0lHF0NqGt7OHuJeeWhgTLizUqcHqVuFJUGmL';
// dog filters
const size = 'large';
const type = 'dog';
const status = 'adoptable';
// token vars
var token, tokenType, expires;

//renders
const Index = props => (
  <Layout>
	<h1>Doggos</h1>
  </Layout>
);

const getOAuth = fetch('https://api.petfinder.com/v2/oauth2/token', {
	method: 'POST',
	body: 'grant_type=client_credentials&client_id=' + key + '&client_secret=' + secret,
	headers: {
	'Content-Type': 'application/x-www-form-urlencoded'
	}
});

getoAuth();

Index.getInitialProps = async function() {

	const getDoggos = await fetch('https://api.petfinder.com/v2/animals?size=' + size + '&type=' + type + '&status=' + status, {
		headers: {
	  	'Authorization': tokenType + ' ' + token,
	  	'Content-Type': 'application/x-www-form-urlencoded'
		}
	});
	const json = await getDoggos.json();

  return {
    doggos: json
  };
};

export default Index;
